package org.springframework.samples.petclinic.vet;

import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertNotNull;
import static org.junit.jupiter.api.Assertions.assertTrue;

import java.util.List;
import java.util.Set;

import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;

public class VetTest {

	private Vet controller;

	@BeforeEach
	void setUp() {
		controller = new Vet();
	}

	@Test
	@DisplayName("getSpecialtiesInternal returns empty set when no specialties added")
	void testGetSpecialtiesInternal_Empty() {
		Set<Specialty> specialties = controller.getSpecialtiesInternal();
		assertNotNull(specialties);
		assertEquals(0, specialties.size());
	}

	@Test
	@DisplayName("getSpecialtiesInternal returns set with added specialties")
	void testGetSpecialtiesInternal_WithSpecialties() {
		Specialty specialty1 = new Specialty();
		Specialty specialty2 = new Specialty();
		controller.addSpecialty(specialty1);
		controller.addSpecialty(specialty2);
		Set<Specialty> specialties = controller.getSpecialtiesInternal();
		assertEquals(2, specialties.size());
		assertTrue(specialties.contains(specialty1));
		assertTrue(specialties.contains(specialty2));
	}

	@Test
	@DisplayName("getSpecialties returns empty list when no specialties added")
	void testGetSpecialties_Empty() {
		List<Specialty> specialties = controller.getSpecialties();
		assertNotNull(specialties);
		assertEquals(0, specialties.size());
	}

	@Test
	@DisplayName("getSpecialties returns list with added specialties")
	void testGetSpecialties_WithSpecialties() {
		Specialty specialty1 = new Specialty();
		Specialty specialty2 = new Specialty();
		controller.addSpecialty(specialty1);
		controller.addSpecialty(specialty2);
		List<Specialty> specialties = controller.getSpecialties();
		assertEquals(2, specialties.size());
		assertTrue(specialties.contains(specialty1));
		assertTrue(specialties.contains(specialty2));
	}

}
